description: "This is the readme.txt for the model associated with the paper.\n\n\
  Huang CW, Chow JC, Tsai JJ, Wu SN. Characterizing the effects of\neugenol on neuronal\
  \ ionic currents and hyperexcitability.\nPsychopharmacology 2011; Dec 13; [Epub\
  \ ahead of print]\n(<http://www.springerlink.com/content/t001557034182482/>)\n\n\
  Abstract\n\nRationale: Eugenol (EUG, 4-allyl-2-methoxyphenol), the main component\n\
  of essential oil extracted from cloves, has various uses in medicine\nbecause of\
  \ its potential to modulate neuronal excitability. However,\nits effects on the\
  \ ionic mechanisms remains incompletely understood.\nObjectives: We aimed to investigate\
  \ EUG's effects on neuronal ionic\ncurrents and excitability, especially on voltagegated\
  \ ion currents,\nand to verify the effects on a hyperexcitability-temporal lobe\
  \ seizure\nmodel. Methods With the aid of patch-clamp technology, we first\ninvestigated\
  \ the effects of EUG on ionic currents in NG108-15 neuronal\ncells differentiated\
  \ with cyclic AMP. We then used modified\nPinsky-Rinzel simulation modeling to evaluate\
  \ its effects on\nspontaneous action potentials (APs). Finally, we investigated\
  \ its\neffects on pilocarpine-induced seizures in rats. Results: EUG\ndepressed\
  \ the transient and late components of INa in the neurons. It\nnot only increased\
  \ the degree of INa inactivation, but specifically\nsuppressed the non-inactivating\
  \ INa (INa(NI)). Its inhibition of\nINa(NI) was reversed by tefluthrin. In addition,\
  \ EUG diminished\nL-type Ca2+ current and delayed rectifier K+ current only at higher\n\
  concentrations. EUG's effects on APs frequency reduction was\nverified by the simulation\
  \ modeling. In pilocarpine-induced seizures,\nthe EUG-treated rats showed no shorter\
  \ seizure latency but a lower\nseizure severity and mortality than the control rats.\
  \ The EUG's\neffect on seizure severity was occluded by the INa(NI) antagonist\n\
  riluzole. Conclusion: The synergistic blocking effects of INa and\nINa(NI) contributes\
  \ to the main mechanism through which EUG affects\nthe firing of neuronal APs and\
  \ modulate neuronal hyperexcitability\nsuch as pilocarpine-induced temporal lobe\
  \ seizures.\n---------\n\nTo run the model; XPP: start with the command \nXpp Neuron\\\
  _EUG01.ode\n\nThis simulation will make a graph similar to figure 6. Notably, press\n\
  Initialconds -> Go \n\n![screenshot](data:image/jpeg;base64,)\n\
  \nand then get the results (Vs, Ina and Ina\\_in) in the left side of\nFigure 6\
  \ in the paper of Huang et al. Then press File Get par Set to\nchange to EUG parameter\
  \ set file, eugenol effects on the firing of\naction potentials shown in the right\
  \ side of Figure 6 in that paper.\n\nBard Ermentrout's website available at <http://www.pitt.edu/~phase/>\n\
  describes how to get and use xpp.\n\nThis model file was submitted by:\nSheng-Nan\
  \ Wu\nDepartment of Physiology\nNational Cheng Kung University Medical College\n\
  Tainan City, Taiwan\nsnwu@mail.ncku.edu.tw"
